import { TextField, Container, Box, Fab } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";

const SearchBar = ({ handleSubmit, handleChange, value }) => {
  return (
    <Box marginBottom={3}>
      <Container
        maxWidth="sm"
        sx={{
          display: "flex",
          alignItems: "center",
          flexWrap: "wrap",
          flexDirection: "column",
        }}
      >
        <TextField
          id="outlined-basic"
          label="Location"
          variant="outlined"
          onChange={handleChange}
          value={value}
          sx={{
            m: 2,
            minWidth: { xs: "200px", sm: "350px" },
            width: "100%",
          }}
          required
        />
        <Fab
          variant="extended"
          size="medium"
          color="primary"
          aria-label="search"
          onClick={handleSubmit}
          sx={{
            mt: 1,
            px: 3,
            boxShadow: 3,
            textTransform: "none",
          }}
        >
          <SearchIcon sx={{ mr: 1 }} />
          Search
        </Fab>
      </Container>
    </Box>
  );
};

export default SearchBar;
